help_chats: "`.เดกเตเตฝเดเดพเดฑเตเดฑเต <เดเดชเตเดทเดฃเตฝ- เดเดชเดฏเตเดเตเดคเตเดจเดพเดฎเด / เดเดกเดฟ>`\n    เด เดธเดฟเดเดเดกเดฟ เดเดชเดฏเตเดเดฟเดเตเดเดฟเดฐเดฟเดเตเดเตเดจเตเดจ เดเตเดฐเตเดชเตเดชเต เดเดฒเตเดฒเดพเดคเดพเดเตเดเตเด.\n\nโข `.เดเตเดฑเตเดฑเตเดฒเดฟเดเตเดเต`\nโข `.เดเตเดฑเตเดฑเต เดฒเดฟเดเตเดเต r` -` เดเดกเตเดฎเดฟเตป เดเดเดเตเดเดพเดฐเดฎเตเดณเตเดณ เดฒเดฟเดเตเดเต เดธเตเดทเตเดเดฟเดเตเดเตเด '\nโข `.เดเดเตเตป เดฒเดฟเดเตเดเต r`\nโข `.เดเดเตเดเต 10` -` เดชเตเดคเดฟเดฏ เดฒเดฟเดเตเดเดฟเดฒเต เดเดชเดฏเตเด เดชเดฐเดฟเดงเดฟ '\n    เด เดธเดฟเดเดเดกเดฟ เดเดชเดฏเตเดเดฟเดเตเดเดฟเดฐเดฟเดเตเดเตเดจเตเดจ เดเตเดฐเตเดชเตเดชเดฟเดจเตเดฑเต เดฒเดฟเดเตเดเต เดจเตเดเตเด.\n\nโข `.ceate (g | b | c) <chreg_name>;<เดเดชเตเดทเดฃเตฝ-เดเดชเดฏเตเดเตเดคเตเดจเดพเดฎเด> `\n    เดเตเดฐเตเดชเตเดชเต เดธเตเดทเตเดเดฟเดเตเดเตเด เดเดฐเต เดชเตเดฐเดคเตเดฏเตเด เดชเตเดฐเต.\n    g - เดฎเตเดเดพเดเตเดฐเตเดชเตเดชเต / เดธเตเดชเตเดชเตผเดเตเดฐเตเดชเตเดชเต\n    b - เดเตเดฑเดฟเดฏ เดเตเดฐเตเดชเตเดชเต\n    เดธเดฟ - เดเดพเดจเตฝ\n\nโข `.เดธเตเดฑเตเดฑเต เดเดเตเดชเดฟเดเต <เดซเตเดเตเดเตเดฏเตเดเตเดเตเดณเตเดณ เดฎเดฑเตเดชเดเดฟ> <เดเดพเดฑเตเดฑเต เดเดชเดฏเตเดเตเดคเตเดจเดพเดฎเด>`\n    เดเตเดฐเตเดชเตเดชเดฟเดจเตเดฑเต เดชเตเดฐเตเดซเตเตฝ เดซเตเดเตเดเต เดธเดเตเดเดฎเดพเดเตเดเตเด.\n\nโข `.เดกเตเตฝเดเตเดชเดฟเดเต <เดเดพเดฑเตเดฑเต เดเดชเดฏเตเดเตเดคเตเดจเดพเดฎเด - เดคเตเดฑเดเตเดเตฝ>`\n    เดเตเดฐเตเดชเตเดชเดฟเดจเตเดฑเต เดชเตเดฐเตเดซเตเตฝ เดซเตเดเตเดเต เดเดฒเตเดฒเดพเดคเดพเดเตเดเตเด.\n\nโข `.เดจเตเตบเดฌเดจเดฒเต '\n    เดเดฐเต เดเตเดฐเตเดชเตเดชเดฟเดฒเต เดเดฒเตเดฒเดพ เดเดเดเดเตเดเดณเตเดฎเดพเดฏเดฟ.\n\nโข `.rmasers`\n    เดเดชเดฏเตเดเตเดคเดพเดเตเดเดณเต เดชเตเดฐเดคเตเดฏเตเดเดฎเดพเดฏเดฟ เดจเตเดเตเดเดเดเตเดฏเตเดฏเตเด."
